@import url("https://fonts.googleapis.com/css?family=Lato|Schoolbell");
@import url("https://fonts.googleapis.com/css?family=Crimson+Text");
.card-header-title {
  font-family: 'Crimson Text', Georgia, 'Times New Roman', Times, serif;
  color: #4a4a4a;
  font-size: 2rem; }

i {
  margin-left: 1em;
  font-size: 20px;
  color: #4a4a4a; }

.hero {
  margin-bottom: 2rem;
  width: 100%; }

.card {
  margin-bottom: 2rem; }

.notification code {
  color: #4a4a4a;
  background-color: inherit; }

.notification {
  border: 1px solid #4a4a4a4a;
  margin-top: 1rem; }

.big-menu {
  display: block;
  height: 250px; }

.nums {
  border: 1px solid grey;
  padding: 4px; }

.container {
  display: grid;
  grid-template-columns: 1fr 3fr;
  grid-template-rows: 200px auto; }

.hero {
  grid-column-start: 1;
  grid-column-end: 3; }

.main {
  grid-column-start: 1;
  grid-column-end: 3;
  grid-template-columns: 1fr 2fr;
  display: grid; }

.card {
  grid-column-start: 2; }
